INSERT INTO `series` VALUES (1,'24 heures chrono',4180,'/images/24.jwg','2001','Stephen Hopkins','C\'est le jour des primaires démocrates en Californie et le sénateur David Palmer, premier candidat noir à l\'élection présidentielle, est favori. Cependant, Jack Bauer, chef de la CAT de Los Angeles (Cellule Anti-Terroriste), apprend que des terroristes s\'apprêtent à assassiner le sénateur. Jack va devoir agir seul car il pense qu\'une taupe s\'est infiltrée dans la CAT. Mais il va rapidement découvrir que sa femme et sa fille sont également visées. Son passé va le rattraper…'),(2,'90210 Beverly Hills',687,'/images/90210.jwg','2008','Darren Star','L\'arrivée à Beverly Hills d\'une famille avec deux enfants du même âge, un garçon et une fille. Le père, Harry Wilson, est un ancien élève du lycée de Beverly Hills. Il s\'était installé à St Louis après avoir obtenu son diplôme. Le voilà forcé de revenir en ville lorsque sa mère, une actrice sur le retour, sombre dans l\'alcool. Il est accompagné de son épouse, Debbie, une ancienne médaillée Olympique, leur fille Annie, ainsi que leur fils adoptif Dixon. Les deux adolescents doivent s\'intégrer dans leur nouvel environnement et s\'y faire des amis...'),(3,'Alias',1299,'/images/alias.jwg','2001','Jan Verheyen','Sydney Bristow travaille comme espionne pour une branche secrète de la CIA, appelée SD-6. C\'est du moins ce qu\'elle croit, jusqu\'au jour où le chef de son unité, Arvin Sloane, fait assassiner son fiancé, après qu\'elle lui a avoué sa double vie. Elle se rend alors à la vraie CIA et devient agent double, pour détruire cette organisation terroriste. Aux côtés de son père et de son agent de liaison, Michael Vaughn, elle combat le SD-6 et Arvin Sloane dans sa quête des artefacts de Rambaldi...'),(4,'Angel',3218,'/images/angel.jwg','1999','David Greenwalt','Afin de se racheter pour tout le mal qu\'il a pu causer au fil des siècles, Angel tente de venir en aide aux personnes en détresse...'),(5,'Battlestar Galactica',1306,'/images/battlestar_galactica.jwg','2003','Ronald D. Moore','Puissants robots, les Cylons règnent en maître sur l\'univers. A bord du dernier vaisseau de guerre, le Galactica, des humains tentent de survivre en entreprenant le voyage de la dernière chance : trouver une légendaire planète appelée la Terre.'),(6,'Better off Ted',414,'/images/better_of_ted.jwg','2009','Victor Fresco','A la tête du département de recherche et développement d\'une grande compagnie sans scrupules, Ted a du succès... et une conscience. Et cela ne fait pas toujours bon ménage ! Il adore son boulot, sa boss Veronica, et ses collègues, Lem, Phil et Linda, mais parfois il se demande si son boulot mérite de passer outre certaines valeurs. Surtout quand on lui demande de créer une dinde suicidaire, de concevoir un métal capable de rebondir ou de cryogéniser un collègue pour les besoins d\'une expérience. Il y a des jours où Ted se pose des questions, vraiment...'),(7,'Bionic Woman',601,'/images/bionic_woman.jwg','2007','Laeta Kalogridis','Suite à un accident de voiture, une jeune femme reçoit des greffes d\'organes bioniques qui décuplent ses sens et ses capacités physiques. Elle est alors recrutée par une agence gouvernementale pour mener des missions top secrètes.'),(8,'Blade',280,'/images/blade.jwg','2006','Davide S. Goyer','Le justicier black mi-homme, mi-vampire poursuit sa traque des suceurs de sang !'),(9,'Blood Ties',550,'/images/bloodties.jwg','2013','Guillaume Canet','New York, 1974. Chris, la cinquantaine, est libéré pour bonne conduite après plusieurs années de prison pour un règlement de compte meurtrier. Devant la prison, Frank, son jeune frère, un flic prometteur, est là, à contrecœur. Ce ne sont pas seulement des choix de « carrières » qui ont séparé Chris et Frank, mais bien des choix de vies et une rivalité depuis l’enfance. Leur père Léon, qui les a élevés seul, a toujours eu pour Chris une préférence affichée, malgré les casses, la prison… Pourtant, Frank espère que son frère a changé et veut lui donner sa chance : il le loge, lui trouve un travail, l’aide à renouer avec ses enfants et son ex-femme, Monica. Malgré ces tentatives, Chris est vite rattrapé par son passé et replonge. Pour Frank, c’est la dernière des trahisons, il ne fera plus rien pour Chris. Mais c\'est déjà trop tard et le destin des deux frères restera lié à jamais.'),(10,'Bones',3933,'/images/bones.jwg','2005','Hart Hanson','Temperance Brennan est une anthropologue hautement qualifiée qui travaille à l\'Institut Jeffersonian. En examinant les squelettes de personnes décédées, elle est capable d\'en reconstituer la vie et les circonstances de la mort. De telles capacités n\'échappent pas au FBI qui fait appel à ses services dans le cadre d\'affaires criminelles lorsque les méthodes traditionnelles d\'identification des corps ne donnent rien. Temperance travaille en collaboration avec l\'agent spécial Seeley Booth, ancien sniper de l\'armée qui se méfie de la science et des scientifiques.'),(11,'Breaking Bad',163,'/images/breaking_bad.jwg','2008','Vince Gilligan','Walter White, 50 ans, est professeur de chimie dans un lycée du Nouveau-Mexique. Pour subvenir aux besoins de Skyler, sa femme enceinte, et de Walt Junior, son fils handicapé, il est obligé de travailler doublement. Son quotidien déjà morose devient carrément noir lorsqu\'il apprend qu\'il est atteint d\'un incurable cancer des poumons. Les médecins ne lui donnent pas plus de deux ans à vivre. Pour réunir rapidement beaucoup d\'argent afin de mettre sa famille à l\'abri, Walter ne voit plus qu\'une solution : mettre ses connaissances en chimie à profit pour fabriquer et vendre du crystal meth, une drogue de synthèse qui rapporte beaucoup. Il propose à Jesse, un de ses anciens élèves devenu un petit dealer de seconde zone, de faire équipe avec lui. Le duo improvisé met en place un labo itinérant dans un vieux camping-car. Cette association inattendue va les entraîner dans une série de péripéties tant comiques que pathétiques.'),(12,'Buffy contre les vampires',4609,'/images/buffy_contre_les_vampires.jwg','1997','Joss Whedon','Buffy Summers aspire à une vie simple et épanouie auprès de sa famille et de ses amis. Mais les démons qui rôdent à Sunnydale lui rappellent sans cesse qu\'elle doit faire face à ses responsabilités de Tueuse.'),(13,'Burn notice',496,'/images/burn_notice.jwg','2007','Matt Nix','Lorsqu\'un agent secret est viré, il ne reçoit pas une lettre des ressources humaines, mais une \"Burn Notice\". Sans en connaître la raison, l\'ex-espion Michael Westen en a été victime et le gouvernement en a fait un indésirable. Aidé de son ex petite amie et de son ancien partenaire, Michael cherche à savoir pourquoi il a été mis sur la touche, pourquoi il a été ainsi éliminé. Pour parvenir à ses fins, il ne peut employer les méthodes habituelles et doit éviter à tout prix d\'attirer l\'attention de ses anciens collègues espions. Afin de financer son enquête personnelle, il propose ses services à ceux que le police ne peut pas, ou ne veut pas, aider...'),(14,'Californication',497,'/images/californication.jwg','2007','Tom Kapinos','Hank Moody est romancier et séparé de la mère de sa fille de 13 ans. Il est aussi accro aux femmes et aux drogues et ne peut s\'empêcher de dire la vérité, tout le temps et à tout le monde. Oui, Hank est auto-destructeur...'),(15,'Caprica',364,'/images/caprica.jwg','2008','Remi Aubuchon','50 ans avant les événements de Battlestar Galactica, sur Caprica, les familles Graystone et Adama sont en conflit. En toile de fond l\'émergence de l\'intelligence artificielle et le développement de la robotique, à l\'origine de la création des Cylons.'),(16,'Charmed',1351,'/images/charmed.jwg','1998','Constance M. Burge','Les trois soeurs Halliwell apprennent à se servir de leurs nouveaux pouvoirs magiques afin de lutter contre le Mal...'),(17,'Chuck',3797,'/images/chuck.jwg','2007','Chris Fedak','Employé dans une boutique de matériel informatique, Chuck Bartowski est propulsé du jour au lendemain dans le monde de l\'espionnage, sa vie ennuyeuse laissant la place aux émotions fortes. Son cerveau renfermant, bien malgré lui, une base de données contenant des secrets gouvernementaux, la NSA et la CIA, soucieuses de protéger ces informations, envoient les agents John Casey et Sarah Walker pour veiller sur sa sécurité. Les informations qu\'il détient nécessitent sa participation à de périlleuses missions, le confrontant à de multiples dangers. Tout ça sous le nez de son meilleur ami, Morgan, de sa soeur, Ellie, et de ses collègues de travail, qui ne se doutent de rien...'),(18,'Cold Case',46,'/images/cold_case.jwg','2003','Meredith Stiehm','Détective de la police de Philadelphie, Lilly Rush enquête sur des affaires non résolues en faisant appel à son instinct, ainsi qu\'à la science moderne...'),(19,'Community',272,'/images/community.jwg','2009','David Guarascio','Jeff est avocat. Mais Jeff doit surtout retourner à l\'université car son certificat a été invalidé. Entre les femmes au foyer fraîchement divorcées et ceux qui reprennent les études pour garder leur esprit actif, Jeff intègre une bande de joyeux drilles qui découvre les joies de la vie sur le campus. Ils en apprennent plus sur eux-mêmes que sur les cours qu\'ils suivent...'),(20,'Criminal Minds',1530,'/images/criminal_minds.jwg','2005','Jeff Davis','L\'équipe des profilers étudie les comportements et les esprits torturés des criminels les plus dangereux du pays, afin d\'anticiper les crimes d\'un éventuel tueur. Chaque membre de cette unité d\'élite a sa personnalité, son histoire mais aussi sa spécialité. Ils sont tous dépendants les uns des autres et les résultats dépendent aussi de cette complémentarité.'),(21,'Cupid',210,'/images/cupid.jwg','2009','Rob Thomas','Trevor Pierce a été envoyé sur Terre avec la mission de former 100 couples, avant de pouvoir retourner au Mont Olympe. Refusant de croire qu\'il est Cupidon en personne, le Dr Claire McCrae garde un oeil sur ce patient pas comme les autres. Trevor va devoir prouver ses talents..'),(22,'Daybreak',514,'/images/daybreak.jwg','2006','Paul Zbyszewski','L\'inspecteur Brett Hopper passe une très mauvaise journée... Accusé du meurtre d\'un procureur, il réalise qu\'il a été piégé et que ses proches sont en danger ! Lorsqu\'il se réveille le matin suivant, il revit cette journée maudite, et en profite pour tenter de découvrir la vérité...'),(23,'Demons',231,'/images/demons.jwg','2009','Howard Overman','Luke Rutherford est un adolescent comme les autres ; depuis le décès de son père, il mène une existence sans histoire aux côtés de sa mère. Mais un jour, un certain Rupert Galvin débarque chez lui bien décidé à bouleverser sa vie. Celui-ci, qui était le meilleur ami de son père, s\'avère être le parrain de Luke. Sa visite n\'a qu\'un seul but : révéler au jeune homme la vérité sur son père, chasseur de créatures maléfiques et surnaturelles, ainsi que sa propre destinée. Car Luke est en réalité le dernier descendant de Van Helsing, le légendaire chasseur de démons. Sans le savoir, il a hérité de pouvoirs hors du commun lui permettant de combattre les monstres les plus féroces. Galvin doit former Luke au plus vite, car sa vie et celle de ses proches sont en danger : les démons sont à sa recherche, prêts à tout pour le tuer avant qu\'il ne devienne assez fort pour les anéantir...'),(24,'Desesperate Housewives',1615,'/images/desesperate_housewives.jwg','2004','Bob Daily','Wisteria Lane est un lieu paisible où les habitants semblent mener une vie heureuse... en apparence seulement ! Car en y regardant de plus près, on découvre bien vite, dans l\'intimité de chacun, que le bonheur n\'est pas toujours au rendez-vous. Et peu à peu, les secrets remontent inévitablement à la surface, risquant de faire voler en éclat le vernis lisse de leur tranquille existence...'),(25,'Dexter',1196,'/images/dexter.jwg','2006','Scott Buck','Brillant expert scientifique du service médico-légal de la police de Miami, Dexter Morgan est spécialisé dans l\'analyse de prélèvements sanguins. Mais voilà, Dexter cache un terrible secret : il est également tueur en série. Un serial killer pas comme les autres, avec sa propre vision de la justice.'),(26,'Dirt',708,'/images/dirt.jwg','2007','Matthew Carnahan','Rédactrice en chef de deux journaux à scandales, Lucy Spiller est animée par le désir de découvrir la vérité. Avec l\'aide de son vieil ami Don Konkey, photographe, elle traque les stars jusque dans leurs derniers retranchements pour révéler au public toutes les choses qu\'ils tentent de dissimuler. Décidant ainsi de leur destin...'),(27,'Dirty sexy money',991,'/images/dirty_sexy_money.jwg','2007','Craig Wright','Les Darling sont une des familles les plus puissantes de New York. Dans la droite lignée des Kennedy, ils ont l\'argent, le pouvoir, des ambitions et une fâcheuse tendance à se retrouver dans des situations impossibles, à fricoter avec des gens peu recommandables... S\'ils n\'avaient pas Nick George, leur avocat, pour les tirer d\'affaire, pour éviter la Une des magazines trash ou, pire, la prison, leur déclin aurait commencé depuis bien longtemps. Pourtant Nick, avocat idéaliste, a longtemps refusé sa destinée : servir les Darling. Avant lui, son père s\'était livré corps et âme à cette famille destructrice en devenant leur conseiller. Nick ne sait pas si servir les Darling est une chance ou une sentence...'),(28,'Doctor Who',2916,'/images/doctor_who.jwg','2005','Russell T. Davies','Extraterrestre de 900 ans, le Docteur est un aventurier qui voyage à travers le temps et l\'espace à l\'aide de son vaisseau, le TARDIS (Time And Relative Dimension In Space), qui, pour mieux s\'adapter à l\'environnement, a l\'apparence d\'une cabine téléphonique. Le Docteur voyage en compagnie d\'une jeune fille. Ensemble, ils font de nombreuses rencontres sur les diverses planètes qu\'ils explorent...'),(29,'Dollhouse',573,'/images/dollholse.jwg','2009','Joss Whedon','Au sein d\'un programme top secret, des hommes et des femmes sont programmés pour remplir des missions spécifiques. Ces dernières peuvent être d\'ordre romantique ou physique mais aussi les faire entrer dans l\'illégalité. Pour qu\'ils remplissent à bien leurs différents contrats, on leur programme à chaque fois une nouvelle personnalité, des capacités et des mémoires différentes. Après chaque mission, leurs souvenirs sont effacés et ils retournent au laboratoire secret nommé Dollhouse. Dans cet étrange univers, Echo, une jeune doll, voit ses souvenirs refaire peu à peu surface...'),(30,'Eleventh Hour',500,'/images/eleventh_hour.jwg','2008','Mick Davis','Jacob Hood est un agent scientifique travaillant pour le gouvernement des Etats-Unis. Sa mission : enrayer les menaces liées aux dérives de la science...'),(31,'Entourage',3166,'/images/entourage.jwg','2004','Doug Ellin','Jeune et séduisant acteur, Vincent Chase rencontre très vite le succès et devient une star adulée à Hollywood. Soucieux de ne pas oublier ses origines, Vince s\'entoure de ses amis d\'enfance originaires comme lui du Queens, l\'un des quartiers pauvres de New York. Avec eux, il partage cette nouvelle aventure dans ce monde de strass et de paillettes.'),(32,'Eureka',908,'/images/eureka.jwg','2006','James Paglia','Depuis des années le gouvernement invite les génies du monde entier à venir s\'installer dans la petite ville d\'Eureka, où la vie s\'écoule doucement entre innovations brillantes et chaos. En accidentant sa voiture et en se retrouvant coincé dans la ville, le marshall Jack Carter se voit embarqué dans une histoire qui le dépasse.'),(33,'Extras',251,'/images/extras.jwg','2005','Ricky Gervais','Andy Millman quitte son emploi afin de poursuivre son rêve : devenir acteur. Mais l\'entreprise se révèle plus difficile que prévue. Le comédien débutant obtient rarement des rôles parlants. Avec son amie Maggie, ils passent beaucoup de temps à envier les acteurs prestigieux dont ils croisent la route...'),(34,'Fear itself',108,'/images/fear_itself.jwg','2008','Victor Salva','Une série d\'anthologie du suspense et de l\'horreur.'),(35,'Flash Forward',300,'/images/flash_forward.jwg','2009','Brannon Barga','Un blackout total de 2 minutes et 17 secondes provoque le chaos à travers le monde. Pendant cette courte durée, chaque personne est confrontée à une vision du futur qui va changer sa vie à jamais...'),(36,'Flashpoint',419,'/images/flashpoint.jwg','2008','Stéphanie Morgenstern','Une plongée dans la vie des membres de la Strategic Response Unit, une force de police canadienne spécialisée dans les opérations paramilitaires. Prises d\'otages, désamorçages de bombes, démantèlements de gangs... Tous les jours, ces policiers pas comme les autres mettent leur vie en jeu pour sauver celles des autres.'),(37,'Flight of the conchords',1428,'/images/flight_of_the_conchords.jwg','2007','Bret McKenzie','Bret McKenzie et Jemaine Clement débarquent à New York dans l\'espoir de se faire un nom dans le monde de la musique. Originaires de la Nouvelle Zélande, les deux hommes ont monté leur propre groupe. Jusqu\'où vont-ils aller ? Surtout avec un agent qui cumule une double casquette de consul de la Nouvelle Zélande...'),(38,'Friday night lights',1622,'/images/friday_night_lights.jwg','2006','Peter Berg','A Dillon, une petite ville du Texas, le championnat d\'état de football est pris très au sérieux. Et l\'équipe du lycée semble extrêmement prometteuse...'),(39,'Friends',1008,'/images/friends.jwg','1994','David Crane','Les péripéties de 6 jeunes newyorkais liés par une profonde amitié. Entre amour, travail, famille, ils partagent leurs bonheurs et leurs soucis au Central Perk, leur café favori...'),(40,'Fringe',1173,'/images/fringe.jwg','2008','J.H. Wyman','Quand un vol international arrive à l\'aéroport de Boston et que les passagers et l\'équipage sont retrouvés morts, l\'agent du FBI Olivia Dunham se voit confier l\'enquête. Lorsque son partenaire est grièvement blessé, elle trouve une aide inattendue auprès du Dr Walter Bishop, un scientifique brillant mais fou, et de son fils, Peter. Ils ne tardent pas à découvrir que le drame du vol 627 n\'est qu\'une infime partie d\'une bien plus grande et choquante vérité...'),(41,'Futurama',1150,'/images/futurama.jwg','1999','Matt Groening','Accidentellement cryogénisé le 31 décembre 1999 alors qu\'il livrait une pizza, Fry se réveille 1000 plus tard à New York. A l\'aube de l\'an 3000, le monde a bien changé, peuplé de robots et d\'extrarrestres. Le jeune homme retrouve l\'un de ses descendants qui l\'engage lui et ses nouveaux amis, Leela et Bender, au Planet Express, une entreprise de livraison. Ensemble, ils vont devoir faire face à de périlleuses et délirantes missions dans un monde des plus surprenants.'),(42,'Gary Unmarried',1466,'/images/gary_unmarried.jwg','2008','Ed Yeager','Un homme divorcé tente de survivre à la vie quotidienne. Entre ses enfants, son ex-femme et sa vie de célibataire, il n\'est pas toujours facile d\'être à la hauteur...'),(43,'Ghost Whisperer',1699,'/images/ghost_wisperer.jwg','2005','John Gray','Melinda Gordon a un don que sa grand-mère avant elle avait également : elle peut communiquer avec l\'esprit des morts. Elle a désormais aussi une mission : relayer les messages des disparus afin de soulager, voire de sauver, les vivants et permettre ainsi aux esprits libérés de passer de l\'autre côté...'),(44,'Gossip Girl',1983,'/images/gossip_girl.jwg','2007','Sara Goodman','La vie de la jeunesse dorée des élèves de deux écoles privées new-yorkaises, vue à travers les yeux ironiques d\'une mystérieuse \"bloggeuse\" surnommée Gossip Girl. Entre amour et amitié, chacun tente de tirer son épingle du jeu, mais rien n\'est jamais simple derrière des apparences parfaites...'),(45,'Greek',1985,'/images/greek.jwg','2007','Patrick Sean Smith','A chaque rentrée, les campus universitaires sont envahis par une marée de nouveaux étudiants, tous à la recherche d\'un meilleur enseignement et surtout d\'une expérience unique. La vie universitaire n\'est pas de tout repos. Et chacun tente de trouver sa place...'),(46,'Greys Anatomy',1678,'/images/greys_anatomy.jwg','2005','Shonda Rimes','Meredith Grey, fille d\'un chirurgien très réputé, commence son internat de première année en médecine chirurgicale dans un hôpital de Seattle. La jeune femme s\'efforce de maintenir de bonnes relations avec ses camarades internes, mais dans ce métier difficile la compétition fait rage...'),(47,'Heroes',816,'/images/heroes.jwg','2006','Mark Verheiden','Partout dans le monde, un certain nombre d\'individus en apparence ordinaires se révèlent dotés de capacités hors du commun : la régénération cellulaire, la téléportation, la télépathie... Ils ne savent pas ce qui leur arrive, ni les répercussions que tout cela pourrait avoir. Ils ignorent encore qu\'ils font partie d\'une évolution qui va changer le monde à jamais !'),(48,'House',213,'/images/house.jwg','2004','David Shore','Le Dr Greg House est un médecin revêche qui ne fait confiance à personne, et encore moins à ses patients. Irrévérencieux et controversé, il n\'en serait que plus heureux s\'il pouvait ne pas adresser la parole à ses patients. Mais House est un brillant médecin. Et avec son équipe d\'experts, il est prêt à tout pour résoudre les cas médicaux les plus mystérieux et sauver des vies.'),(49,'How I met your mother ',2693,'/images/how_i_met_your_mother.jwg','2005','Carter Bays','Ted se remémore ses jeunes années, lorsqu\'il était encore célibataire. Il raconte à ses enfants avec nostalgie ses moments d\'égarements et de troubles, ses rencontres et ses recherches effrénées du Grand Amour et les facéties de sa bande d\'amis...'),(50,'In treatment',697,'/images/in_treatment.jwg','2008','Rodrigo Garcia','Un thérapeute compétent, attentionné et apaisant, dont la vie privée est un véritable désastre, pleine de doutes et de colère contenue, consulte à son tour un thérapeute..'),(51,'Invasion',782,'/images/invasion.jwg','2007','Oliver Hirschbiegel','Une immense explosion embrase le ciel, de Dallas à Washington, répandant\n sur des milliers de kilomètres carrés les restes de la navette spatiale\n Patriot. Les autorités prennent rapidement la situation en main, mais \nd\'étranges rumeurs ne tardent pas à circuler : on aurait trouvé, collée \naux fragments de l\'engin, une matière inconnue, hautement toxique, \ncapable de résister à des températures extrêmes. Et les premiers à \nentrer en contact avec elle n\'auraient plus d\'humain que l\'apparence... \nMais pas question de déclencher la panique pour autant. Quelque temps après le crash, Carol assiste à une vague de phénomènes aberrants. Une \nde ses patientes se plaint, par exemple, qu\'on lui a \"changé\" son mari. \nSimple délire ? Mais pourquoi tant de gens à travers le pays en sont-ils\n affectés ? Et pourquoi les rues des villes sont-elles devenues si \npaisibles, comme si personne n\'osait plus s\'énerver ? Plus inquiétant : \nOliver, le jeune fils de Carol, ramène le jour d\'Halloween un sucre \nd\'orge enduit d\'une matière inconnue... et vivante !'),(52,'Jake 2.0',344,'/images/jake.jwg','2003','Silvio Horta','Accidentellement doté de superpouvoirs grâce à la nano-technologie, un ancien technicien informatique devient agent pour la NSA.'),(53,'Jekyll',279,'/images/jekyll.jwg','2009','Steven Moffat','Mister Hyde est de retour ! Mais que les braves gens se rassurent, aujourd\'hui, le docteur Jackman (Jekyll, pour les intimes) vit (presque) en harmonie avec son alter égo maléfique. Pourtant, mister Hyde ignore que Jekyll a une famille, dont il s\'emploie par tous les moyens à cacher l\'existence. Sa petite vie tranquille est bouleversée le jour où une vieille organisation connaissant son secret décide de l\'utiliser pour servir ses interêts.'),(54,'Jericho',1457,'/images/jericho.jwg','2006','Stephen Chbosky','Une catastrophe nucléaire plonge les habitants d\'une petite ville du Kansas dans le chaos. Le pays est-il complètement ravagé ? Y a-t-il d\'autres survivants ? Les doutes, les peurs et le désespoir commencent à gagner le petit groupe de survivants. Mais face à cette épreuve, le pire comme le meilleur peut surgir en chaque être humain...'),(55,'John from Cincinnati',357,'/images/john_from_cincinnati.jwg','2007','Kem Nunn','Les Yost vivent à Imperial Beach, au sud de la Californie, tout près de la frontière mexicaine. Ancienne gloire du surf, Mitch, le patriarche, est marié à la désespérée Cissy. Le couple a deux enfants : Butchie, ancien surfeur toxicomane à la vie dissolue, et Shaun. Leur petit monde est chamboulé le jour où John, un jeune homme venu tout droit de Cincinnati pour prendre des leçons de surf, débarque à Imperial Beach. Egalement de retour, Barry Cuningham est déterminé à se venger des Yost...'),(56,'Journeyman',279,'/images/jolrney_man.jwg','2007','Alex Graves','Ayant trouvé le moyen de voyager dans le passé, Dan Vasser peut modifier le présent et le futur. Si l\'impact souhaité est d\'améliorer la vie des gens, quelques mauvaises surprises peuvent survenir. Lors d\'une excursion dans le passé, il retrouve Livia, son ex-fiancée décédée dans un mystérieux accident d\'avion. La sauver bouleversera-t-il sa vie actuelle ? Dan a pourtant tout pour être heureux : une épouse aimante, un fils génial et un boulot sympa. Veut-il vraiment tout changer ? Quelles seront les conséquences ?'),(57,'Knight rider',1201,'/images/knight_rider.jwg','1982','Glen A. Larson','Les exploits d\'un chevalier solitaire dans un monde dangereux. Le chevalier et sa monture. Un héros des temps modernes, dernier recours des innocents, des sans espoir, victimes d\'un monde cruel et impitoyable.Michael Knight sillonne les routes américaines au volant de Kitt, sa voiture intelligente et indestructible, pour combattre les injustices et venir en aide aux innocents.'),(58,'Kyle XY',2966,'/images/kyle_xy.jwg','2006','J. Mackye Gruber','Après avoir été trouvé errant et confus, Kyle est placé dans une institution. Il y rencontre la psychiatre Nicole Trager, qui décide de le ramener chez elle, au grand désespoir de ses deux enfants, Lori et John, et même de son mari. Bientôt, à mesure que le mystérieux jeune homme montre des possibilités et des capacités inouïes, une question revient avec insistance : d\'où vient Kyle ?'),(59,'Legends of the seeker',1308,'/images/legend_of_the_seeker.jwg','2008','Raf Green','Le guide forestier Richard Cypher va devoir quitter Terre d\'Ouest pour affronter le maléfique Darken Rahl et restaurer la paix sur le monde. Dans cette aventure qui promet d\'être épique, l\'Elu bénéficie du soutien de la belle Kahlan Amnell et du grand sorcier Zedd...'),(60,'Leverage',534,'/images/leverage.jwg','2008','Chris Downey','Des escrocs de haute-volée allient leurs forces pour dépouiller les criminels les plus riches et les grands patrons corrompus.'),(61,'Lie to me',593,'/images/lie_to_me.jwg','2009','Sam Baum','Le Dr Cal Lightman est un scientifique spécialisé dans la détection du mensonge. Qui que vous soyez, il sait si vous dites ou non la vérité... Véritable détecteur de mensonges fait homme, il sait décrypter sur un visage, dans une attitude ou au son d\'une voix, la fausseté et le secret. Cette extraordinaire aptitude l\'aide tout particulièrement dans les enquêtes criminelles qu\'il résout au sein de son agence de détectives privés. Mais, dans sa vie privée, c\'est une toute autre histoire...'),(62,'Life',663,'/images/life.jwg','2007','Rand Ravich','Après avoir été emprisonné pendant plusieurs années à tort, Charlie Crews, ancien flic, retourne dans les rangs de la police. Il adopte dès lors une philosophie de vie résoluement différente et travaille aux côtés de sa nouvelle partenaire, Dani Reese, dans un monde qui a bien changé.'),(63,'Lost',1523,'/images/lost.jwg','2004','Damon Lindelof','Après le crash de leur avion sur une île perdue, les survivants doivent apprendre à cohabiter et survivre dans cet environnement hostile. Bien vite, ils se rendent compte qu\'une menace semble planer sur l\'île...'),(64,'Mad Men',532,'/images/mad_men.jwg','2007','Matthew Weiner','Dans le New York des années 60, Don Draper est l\'un des grands noms de la pub. Maître manipulateur, il compte dans son entourage des ennemis qui attendent sa chute.'),(65,'Masters of Science Fiction',207,'/images/masters_of_science_fiction.jwg','2007','Sam Egan','Une anthologie de la science-fiction, présentée par le physicien Stephen Hawking.'),(66,'Medium',2066,'/images/medium.jwg','2005','Glenn Gordon','Médium, Allison Dubois voit et entend les morts. Elle met alors ses dons au service de la police pour résoudre des affaires inexpliquées.'),(67,'Melrose Place ',386,'/images/melrose_place.jwg','1992','Darenn Star','Les habitants d\'un petit immeuble de Melrose Place, un quartier de Los Angeles, n\'ont pas la vie facile : chômage, maladie, violence et trahison font râge chez les locataires qui traversent des épreuves plus ou moins heureuses, voire dramatiques.'),(68,'Mental',187,'/images/mental.jwg','2009','Dan Levine','Psychiatre peu conventionnel, Jack Gallagher met ses services à contribution dans une clinique spécialisée de Los Angeles, sous la responsabilité d\'une patronne préférant les méthodes traditionnelles.'),(69,'Merlin',747,'/images/merlin.jwg','2008','Julian Murphy','Dans la mythique cité de Camelot, certaines histoires se racontent comme on le fait aujourd\'hui, au XXIème siècle. Entre enchantements et mystères, c\'est là qu\'un jeune homme nommé Merlin se lie d\'amitié avec un certain Arthur...'),(70,'Moonlight ',425,'/images/moonlight.jwg','2007','Trevor Munso','Un vampire, devenu détective privé, tente de concilier sa nature immortelle, l\'adversité qui règne dans le monde des vampires et son amour pour une mortelle : se servant de ses pouvoirs pour aider les humains, plutôt que pour s\'en nourir, Mick, mordu le jour de ses noces par sa femme Coraline, entretient une profonde antipathie pour ceux qui ne voient dans les mortels que nourriture.'),(71,'My name is earl',1652,'/images/my_name_is_earl.jwg','2005','Greg Garcia','Earl, un escroc à la petite semaine, gagne au loto. A partir de ce jour, il décide de racheter toutes les fautes qu\'il a commises dans sa vie, une par une...'),(72,'NCIS',4699,'/images/ncis.jwg','2003','Gary Glasberg','La Naval Criminal Investigative Service regroupe une équipe d\'agents spéciaux chargés d\'enquêter sur des crimes concernant la Marine.'),(73,'NCIS Los Angeles',369,'/images/ncis_los_angeles.jwg','2009','Shane Brennan','L’O.P.S. (Office des Projets Spéciaux) est une division du NCIS basée à Los Angeles et spécialisée dans les missions d’infiltration. “Tête brûlée” de l’équipe, l’agent “G” Callen change d’identité à chaque nouvelle mission. Son partenaire, l’agent Sam Hanna, est un ancien militaire spécialisé dans la surveillance. Grâce à une technologie de pointe et à des agents caméléons spécifiquement entraînés, cette unité mène à bien des opérations complexes pour déjouer attentats et menaces terroristes.'),(74,'Nip Tuck',2135,'/images/nip_tuck.jwg','2003','Ryan Murphy','Deux médecins spécialisés dans la chirurgie esthétique jonglent entre leurs patients de la clinique privée de Miami dans laquelle ils travaillent et leurs vies privées mouvementées...'),(75,'One tree hill',3402,'/images/one_tree_hill.jwg','2003','Mark Schwahn','Lucas et Nathan, deux demi-frères que tout sépare, se retrouvent rivaux non seulement sur le terrain de leur équipe de basket mais aussi dans le coeur d\'une fille.'),(76,'Oz',688,'/images/oz.jwg','1997','Tom Fontana','Oz. Oswald. Pénitencier de haute sécurité. Emerald city. Quartier expérimental de la prison créé par le visionnairae Tim McManus qui souhaite améliorer les conditions de vie des détenus. Mais dans cet univers clos et étouffant se recrée une société terrifiante où dominent la haine, la violence, la peur, la mort. Où tout espoir est vain, où la rédemption est impossible. \"Oz est l\'endroit où je vis. Oz est l\'endroit où je vais mourir, où la plupart d\'entre nous vont mourir. Ce que nous sommes importe peu. Ce que nous allons devenir ne compte pas\" explique le narrateur depuis sa cage en verre. Bienvenue dans l\'antichambre de l\'enfer.'),(77,'Painkiller Jane',489,'/images/painkiller_jane.jwg','2007','Gil Grant','Dans un futur proche, où le terrorisme fait rage et où la situation économique et sociale est guère rejouissante, le gouvernement garde le secret sur l\'existence des Neuros, des humains dont les gènes ont été modifiés, leur conférant des supers pouvoirs. Craignant les dérives d\'individus capables de télékinésie ou télépathie, une organisation secrète est créée pour traquer ces spécimens. Jane Vasko intègre cette unité chargée de localiser et neutraliser les Neuros. La jeune femme ne tarde cependant pas à découvrir qu\'elle est elle-même dotée d\'une incroyable faculté à s\'auto-régénérer, lui permettant de guérir rapidement à des blessures.'),(78,'Primeval',314,'/images/primeval.jwg','2007','Tim Haines','L\'Angleterre est le théâtre d\'étranges phénomènes : des créatures préhistoriques apparaissent aux quatre coins du Royaume... Le professeur Cutter, un homme brillant mais hanté par la disparition de sa femme, et son équipe se lancent à leur poursuite et tentent de découvrir comment ces espèces disparues depuis des milliers d\'années ont pu réapparaître soudainement.'),(79,'Prison Break',1508,'/images/prison_break.jwg','2005','Paul Scheuring','Michael Scofield s\'engage dans une véritable lutte contre la montre : son frère Lincoln est dans le couloir de la mort, en attente de son exécution. Persuadé de son innocence mais à court de solutions, Michael décide de se faire incarcérer à son tour dans le pénitencier d\'état de Fox River pour organiser leur évasion...'),(80,'Private Practice',651,'/images/private_practice.jwg','2007','Shonda Rhimes','Après avoir échoué à se réconcilier avec les deux hommes de sa vie, le Dr Addison Montgomery quitte l\'hôpital du Seattle Grace pour Los Angeles. Elle y retrouve des amis d\'université, notamment Naomi et Sam, et accepte un poste dans leur clinique spécialisée dans la fertilité et la médecine parallèle. Peu à peu, sa vision idéaliste du mariage et des réussites professionnelles se dégrade, en constatant que même des conseillers conjugaux ne parviennent pas à faire fonctionner leur propre mariage...'),(81,'Psych',2649,'/images/psych.jwg','2006','Steve Franks','Fils de policier, Shawn Spencer a toujours appris à observer et noter les moindre détails. Lorsqu\'il est accusé d\'un crime à tort, il convainc la police qu\'il a des pouvoirs psychiques et les aide à résoudre des affaires...'),(82,'Pushing Daisies',675,'/images/pushing_daisies.jwg','2007','Bryan Fuller','Depuis l\'enfance, Ned sait qu\'il a un don un peu spécial. Il peut, très brièvement, ramener les gens à la vie. Adulte, il est devenu un fantastique pâtissier passant son temps libre à aider son seul ami, un détective privé, dans ses enquêtes. Ramener à la vie des victimes peut en effet être utile. Mais le jour où Ned ressuscite son amour d\'enfance et que cette dernière reste \"vivante\", tout se complique : s\'il venait à la toucher une nouvelle fois, elle partirait définitivement...'),(83,'Raines',147,'/images/raines.jwg','2007','Graham Yost','Michael Raines résout les meurtres à sa façon : les victimes l\'aident dans ses enquêtes. Les morts lui apparaissent dans des visions et l\'aident à retrouver leur tueur. Une fois l\'énigme résolue, ils disparaissent... Ses collègues le prennent pour un fou, Raines aussi parfois en vient à douter de sa santé mentale.'),(84,'Reaper',562,'/images/reaper.jwg','2007','Tara Butters','A l\'âge de 21 ans, Sam découvre que ses parents ont vendu son âme au Diable avant sa naissance. Conformément à l\'accord passé quelques années plus tôt, Satan en personne réclame aujourd\'hui son dû ! Il exige que Sam le serve en tant que chasseur d\'âmes. Sa mission est de retrouver les âmes qui se sont échappées et les ramener en Enfer. Après 20 premières années où tout lui était permis, le jeune homme doit faire face à ses responsabilités et embrasser sa destinée.'),(85,'Robin Hood',3011,'/images/robin_hood.jwg','2006','Foz Allan','Après 5 ans de croisades, Robin de Locksley rentre enfin chez lui pour découvrir avec effroi que les tyrannique Shérif de Nothingham et Guy de Gisbourne y règnent en maîtres absolus. Pour la population, tout n\'est que désolation et misère... Afin de rétablir un ordre plus juste, Robin et ses compagnons Will Scarlett, Allan A Dale et Petit Jean investissent la forêt de Sherwood et deviennent des hors-la-loi... La légende de Robin des Bois est née.'),(86,'Rome',342,'/images/rome.jwg','2005','William J. MacDonald','Les destins de deux soldats romains et de leurs familles alors que la République Romaine est en train de s\'effondrer en laissant peu à peu la place à un Empire.'),(87,'Samantha who',249,'/images/samantha_who.jwg','2007','Donald Todd','Sam se réveille à l\'hôpital après huit jours passés dans le coma. Malheureusement, elle n\'a pas un souvenir de son passé, et doit recommencer sa vie. Elle découvre alors qu\'elle n\'était pas une personne très honnête et sympathique : en définitive, elle avait tout d\'une garce ! La nouvelle Sam tente alors de concilier celle qu\'elle a été et celle qu\'elle voudrait être, mais le juste milieu n\'est jamais simple à trouver...'),(88,'Sanctuary',285,'/images/sanctuary.jwg','2007','Damian Kindler','Le monde recèle de monstres lâchés dans la nature. Et ils sont la clef de notre évolution et du futur de notre race ! Avec l\'aide de Will Zimmerman, de sa fille Ashley et de son majordome Bigfoot, le Dr Helen Magnus, traque ces créatures pour leur venir en aide et pour le besoin de ses recherches.'),(89,'Scrubs',2222,'/images/scrubs.jwg','2001','Bill Lawrence','J.D., Turk et Elliot font leur internat de médecine à l\'hôpital du Sacré Coeur. Ils y découvrent que la vie n\'y est pas facile et se retrouvent bien souvent dans des situations des plus loufoques.'),(90,'Sex and the city',998,'/images/sex_and_the_city.jwg','1998','Darren Star','Célibataire new-yorkaise, Carrie s\'inspire de sa propre expérience, et de celle de ses amies, pour écrire des articles sur des thèmes touchant le sexe et les relations amoureuses.'),(91,'Six feet under',2068,'/images/six_feet_under.jwg','2001','Alan Ball','La vie des membres de la famille Fisher bascule lorsque le père meurt dans un accident, laissant ainsi la direction de la société de pompes funèbres qu\'il a fondée à ses deux fils.'),(92,'Skins',481,'/images/skins.jwg','2007','Jamie Brittain','Un groupe de jeunes adolescents britanniques vivent à Bristol et font leurs premières expériences du monde adulte, en se déchirant autour de sujets comme la religion, la sexualité, la drogue, les déséquilibres alimentaires...'),(93,'Smallville',10127,'/images/smalville.jwg','2001','Alfred Gough','Dans une petite bourgade qui a connu une pluie de météorites quelques années plus tôt, le jeune Clark Kent est élevé par une famille de fermiers. Contraint de cacher ses pouvoirs exceptionnels, il va apprendre à les utiliser pour aller au secours de son prochain.'),(94,'Sons of Anarchy',497,'/images/sons_of_anarchy.jwg','2008','Kurtt Sutter','Afin de protéger leur ville des dealers et des entrepreneurs locaux, les membres d\'un club de motos sont prêts à tout. Dans ce contexte critique, Jax Teller est partagé entre l\'amour qu\'il porte à sa confrérie et l\'appréhension grandissante qu\'il nourrit en voyant l\'anarchie et le banditisme qui règne dans son club...'),(95,'South Park',2296,'/images/south_park.jwg','1997','Matt Stone','La petite ville de South Park dans le Colorado est le théâtre des aventures de Cartman, Stan, Kyle et Kenny, quatre enfants qui ont un langage un peu... décalé !'),(96,'Spaced',289,'/images/spaced.jwg','1999','Simon Pegg','Tim et Daisy sont deux losers complètement paumés. Décidés à se serrer les coudes pour s\'en sortir, ils se font passer pour un couple honnête sous tous rapports afin de trouver un logement. Ils réussissent à convaincre Marsha Klein de leur louer un appartement dans une pension. C\'est le début des ennuis..'),(97,'Stargate Atlantis',2376,'/images/stargate_atlantis.jwg','2004','Brad Wright','Une nouvelle Porte des étoiles découverte dans la cité perdue d\'Atlantis, au milieu des glaces de l\'Antarctique, devient la nouvelle base secrète de l\'armée. L\'équipe Stargate : Atlantis a pour mission d\'explorer la galaxie Pegase, où de nombreuses planètes ont été peuplées par la civilisation humaine qui vivait autrefois dans la cité d\'Atlantis. Dans cet univers encore inconnu de la Terre, la nouvelle équipe d\'explorateurs rencontrera un nouvel ennemi craint de tous : The Wraith...'),(98,'Stargate SG-1',1359,'/images/stargate_sg1.jwg','1997','Brad Wright','Suite à la découverte de la \"Porte des étoiles\", le colonel Jack O\'Neill et son équipe partent à la découverte de mondes et civilisations inconnus...'),(99,'Stargate Universe',391,'/images/stargate_universe.jwg','2009','Brad Wright','Une base secrète de scientifiques, de soldats et de civils située à des millions d\'années-lumière de la Terre est brutalement attaquée par un puissant ennemi. Les survivants n\'ont alors d\'autre choix que de traverser la Porte des Etoiles grâce au 9ème chevron afin d\'échapper à la destruction imminente de la planète. Leur voyage interstellaire les conduit sur Le Destiny, un vaisseau spatial unique créé par les Anciens mais dont les capacités à fournir de l\'oxygène s\'amenuisent rapidement. Coupés du monde, ils vont tout faire pour survivre et tenter de rejoindre la Terre, leur planète d\'origine...'),(100,'Supernatural',3519,'/images/supernatural.jwg','2005','Eric Kripke','Deux frères parcourent les Etats-Unis pour traquer les forces du Mal. Ils espèrent par la même occasion mettre la main sur le démon responsable de la mort de leur mère, vingt ans plus tôt.'),(101,'Swingtown',373,'/images/swingtown.jwg','2008','Mike Kelley','Dans les années 70, Susan et Bruce Miller déménagent dans la banlieue de Chicago, où ils découvrent l\'impact de la libération sexuelle et spirituelle qui règne alors sur cette ville. Dans ce climat de changement, ils comprennent rapidement que chacun à Swingtown est confronté à ses choix personnels et à ses expériences.'),(102,'The 4400',1343,'/images/the_4400.jwg','2004','Scott Peters','Au cours du siècle dernier, des milliers de personnes ont mystérieusement disparu. Soudainement et inexplicablement, 4400 personnes portées disparues réapparaissent telles qu\'elles étaient au moment de leur disparition. Même celles disparues depuis plusieurs décennies n\'ont pas pris une ride. Et surtout, personne ne se souvient de rien. Alors que tout ce beau monde tente de reprendre une vie normale, deux agents du FBI sont chargés d\'enquêter sur cet étrange phénomène. Ils découvrent rapidement que ces individus risquent de changer l\'Humanité à jamais.'),(103,'The big bang theory',961,'/images/the_big_bang_theory.jwg','2007','Steve Holland','Leonard et Sheldon pourraient vous dire tout ce que vous voudriez savoir à propos de la physique quantique. Mais ils seraient bien incapables de vous expliquer quoi que ce soit sur la vie \"réelle\", le quotidien ou les relations humaines... Mais tout va changer avec l\'arrivée de la superbe Penny, leur voisine. Ce petit bout de femme, actrice à ses heures et serveuse pour le beurre, va devenir leur professeur de vie !'),(104,'The Black Donnellys',751,'/images/the_black_donnellys.jwg','2007','Bobby Moresco','Faites connaissance avec les Donnelly : Tommy (le futé), Jimmy (le sanguin), Kevin (le malchanceux) et Sean (le beau gosse). Ces quatre frères d\'origine irlandaise seraient prêts à tout pour se protéger les uns, les autres, même à mentir, tricher, voler et, parfois, faire appel aux flics. L\'aspirant gangster Joey \"Ice Cream\" nous raconte l\'histoire de cette fratrie au moment même où les Donnelly s\'apprêtent à faire leurs premiers pas dans le crime organisé. Ce passage à l\'âge adulte va affecter leurs vies à tout jamais et celles de leur famille et amis.'),(105,'The kill point',222,'/images/the_kill_point.jwg','2007','Bryan Goluboff','De retour d\'Irak, un groupe de vétérans de l\'armée organise le braquage d\'une grande banque de Pittsburgh. Mais les choses tournent mal et le vol devient vite une prise d\'otages...'),(106,'The Lost room',161,'/images/the_lost_room.jwg','2006','Laura Harkcom','Juste avant de mourir, un jeune homme confie à l\'inspecteur Joe Miller la clé d\'une chambre de l\'hôtel Sunshine, située aux abords de la mythique Route 66. Il ne sait pas encore qu\'il vient d\'entrer en possession d\'un objet puissant et terriblement convoîté, ouvrant une porte vers un univers parallèle. Miller, qui s\'est lancé à la recherche de sa fille perdue dans cette chambre d\'hôtel, devient la proie de tous et de tout ce qui désire son bien le plus précieux : la clé.'),(107,'The Mentalist',683,'/images/the_mentalist.jwg','2008','Bruno Heller','Un mentaliste utilise ses extraordinaires dons d\'observation pour résoudre des crimes en tant que consultant travaillant aux côtés de la police. Une façon pour lui contribuer à la justice et de démasquer le mystérieux tueur en série qui a assassiné son épouse et sa fille...'),(108,'The Nine',149,'/images/the_nine.jwg','2006','Tom Garrigus','Une interminable prise d\'otages se termine en un véritable carnage ! Seules neuf personnes en réchappent. Que s\'est-il passé lors des longues heures d\'angoisse à l\'intérieur de la banque ? Après un tel traumatisme, une vie normale est-elle encore envisageable ? Une chose est sûre : leurs vies sont à jamais affectées...'),(109,'The OC ',2593,'/images/the_oc.jwg','2003','Josh Schwartz','Lorsque Ryan Atwood arrive à Newport Beach, il est loin de se douter de ce qui l\'attend. Située dans le plus riche comté de la Californie, l\'Orange County, cette ville abrite les familles les plus aisées et le change radicalement du quartier pauvre où il a grandi. Ryan devra se faire une place au milieu de tout ce beau monde et pourra compter sur le soutien de son nouvel ami Seth, qui a lui aussi fort à faire avec la jolie Summer, dont il est amoureux depuis sa plus tendre enfance mais qui ne le remarque pas...'),(110,'The pretender',2822,'/images/the_pretender.jwg','1996','Steven Long Mitchell','Utilisé par le Centre depuis son plus jeune âge pour des simulations qui ont coûté la vie à de nombreuses personnes, Jarod s\'échappe. Pendant que Sydney et Mlle Parker sont à ses trousses, il tente par tous les moyens de retrouver sa famille. Il en profite aussi pour utiliser ses dons de \"caméléon humain\" afin de réparer quelques injustices.'),(111,'The riches',755,'/images/the_riches.jwg','2007','Dmitry Lipkin','Les Malloy sont une famille d\'escrocs, toujours sur la route, constamment en fuite. Traversant une crise existentielle, Wayne Malloy décide de s\'installer dans un charmant et paisible petit quartier résidentiel avec sa femme et ses 3 enfants. Ils changent de nom et se font passer pour les Riches, des voisins tranquilles et sans histoires. Mais il n\'est pas toujours évident de fuir son passé...'),(112,'The Sarah Connor chronicles',755,'/images/the_sarah_connor_chronicles.jwg','2008','Josh Friedmann','Sarah Connor et son fils John se retrouvent seuls dans un monde hostile et complexe, après être venus à bout du Terminator. Ils fuient la loi et doivent combattre des ennemis en provenance du présent comme du futur. Sarah décide alors qu\'il est temps de cesser de courir et d\'affronter ses assaillants de face...'),(113,'The shield',2204,'/images/the_shield.jwg','2002','Shawn Ryan','Pour rétablir l\'ordre dans les secteurs les plus dangereux de Los Angeles, une brigade de police en arrive à mettre en oeuvre des méthodes plutôt expéditives et inhabituelles.'),(114,'The sopranos',995,'/images/the_sopranos.jwg','1999','David Chase','Chef de la mafia et père de famille, Tony Soprano confie ses angoisses au Dr Jennifer Melfi, son psychiatre.'),(115,'The tudors',1557,'/images/the_tudors.jwg','2007','Michael Hirst','La vie très tourmentée du jeune Henry VIII lors de son début de règne au 16ème siècle en Angleterre ! De ses relations tumultueuses avec les femmes à ses alliances politiques...'),(116,'The Vampire Diaries ',492,'/images/the_vampire_diaries.jwg','2009','Julie Plec','Quatre mois après le tragique accident de voiture qui a tué leurs parents, Elena Gilbert, 17 ans, et son frère Jeremy, 15 ans, essaient encore de s\'adapter à cette nouvelle réalité. Belle et populaire, l\'adolescente poursuit ses études au Mystic Falls High en s\'efforçant de masquer son chagrin. Elena est immédiatement fascinée par Stefan et Damon Salvatore, deux frères que tout oppose. Elle ne tarde pas à découvrir qu\'ils sont en fait des vampires...'),(117,'The Wire',593,'/images/the_wire.jwg','2002','David Simon ','Quand la police s\'efforce de démanteler un réseau tentaculaire de trafic de drogue et du crime à Baltimore.'),(118,'Torchwood',671,'/images/torchwood.jwg','2006','Russell T.Davies','A la tête de l\'organisation Torchwood de Cardiff, le capitaine Jack Harkness et son équipe utilisent les technologies extra-terrestres pour venir à bout de problèmes qui dépassent le gouvernement et la police. Unis, ils se battent pour le futur de l\'humanité. Car c\'est au 21ème siècle que tout va se jouer...'),(119,'Travelers',220,'/images/travelers.jwg','2016','Brad Wright','Des centaines d\'années dans le futur, des hommes parviennent à se téléporter au XXIème siècle en prenant pour hôtes des personnes sur le point de mourir. La nouvelle équipe de voyageurs doit remplir un certain nombre de missions pour empêcher la destruction de l\'humanité à venir. Dans l\'intervalle, chacun doit se glisser dans la peau de son hôte sans éveiller de soupçons : une jeune maman battue par son époux, un agent du FBI, un junkie, un lycéen et... une déficiente mentale.'),(120,'Tru Calling ',2150,'/images/tru_calling.jwg','2003','Jon Harmon Feldman','Etudiante en médecine, Tru travaille à mi-temps dans une morgue. Parfois, des cadavres lui demandent de les aider. Tru revit alors sa dernière journée, et va tout tenter pour sauver la personne. Mais c\'est sans compter sur Jack qui va lui compliquer la tâche...'),(121,'True Blood',698,'/images/true_blood.jwg','2008','Mark Hudis','Ayant trouvé un substitut pour se nourrir sans tuer (du sang synthétique), les vampires vivent désormais parmi les humains. Sookie, une serveuse capable de lire dans les esprits, tombe sous le charme de Bill, un mystérieux vampire. Une rencontre qui bouleverse la vie de la jeune femme...'),(122,'Ugly Betty',5160,'/images/ugly_betty.jwg','2006','Silvio Horta','Betty Suarez n\'est pas spécialement belle, mais elle est douce, intelligente et travaille dur. Dans un monde régi par les apparences, ses qualités sont invisibles. Pourtant, le Président de Meade Publications l\'engage pour devenir l\'assistante de son fils, Daniel, récemment promu à la tête d\'un prestigieux magazine de mode. Il espère ainsi obliger son futur successeur à s\'intéresser davantage à son travail plutôt qu\'à la gent féminine. Si au début leur association est explosive, ils vont bientôt devenir une paire redoutable...'),(123,'V',285,'/images/v.jwg','2009','Kenneth Johnson','2009, le monde se réveille alors que vingt-neuf gigantesques vaisseaux survolent les plus grandes villes. Les extraterrestres et leur leader Anna déclarent venir en paix, mais certaines personnes ne leur font pas confiance. L\'agent spécial Erica Evans découvre que les aliens ont infiltré depuis longtemps les gouvernements et sociétés, afin de prendre le contrôle de la planète. Erica rejoint un mouvement de résistance, dans lequel est présent Ryan, lui-même alien mais souhaitant sauver l\'humanité. De son côté, Tyler, le fils d\'Erica, est séduit par Lisa, une extraterrestre.'),(124,'Veronica Mars',2220,'/images/veronica_mars.jwg','2009','Rob Thomas','Veronica Mars semble être au premier abord une adolescente ordinaire. En fait, futée et courageuse, la jeune fille s\'emploie à résoudre les mystères les plus enfouis que cache la petite communauté de Neptune. Et par la même occasion, elle espère élucider le scandale qui a ruiné la vie de son père...'),(125,'Weeds',640,'/images/weeds.jwg','2012','Jenji Kohan','Dans une banlieue respectable de Los Angeles, les apparences sont parfois trompeuses. Les sales petits secrets des uns et des autres vont peu à peu se faire jour. Nancy Botwin, une mère célibataire, vend de la marijuana depuis la mort subite de son mari. C\'est sa façon à elle de subvenir aux besoins de sa famille...'),(126,'Whitechapel',84,'/images/whitechapel.jwg','2009','Ben Court','Quand une série de crimes sanglants a lieu, un homme est convaincu que quelqu\'un marche dans les traces de l\'assassin Jack l\'Eventreur, 120 ans après.'),(127,'Women\'s Murder Club',251,'/images/womens_murder_club.jwg','2007','Sarah Fain','L\'inspecteur Lindsay Boxer a la faculté d\'analyser une scène de crime en quelques secondes. Frustrée par la lenteur de la procédure qui peut faire traîner une enquête sur plusieurs mois, voire des années, et agacée par ce milieu encore trop réservé aux hommes, elle réunit une équipe de femmes, toutes expertes dans leur domaine (médecin légiste, journaliste, assistante du procureur) pour mener leurs propres investigations et tenter de faire avancer les enquêtes plus efficacement. Entre les crimes à résoudre et leurs vies personnelles mouvementées, des liens d\'amitié se tissent inévitablement...'),(128,'X-Files',2882,'/images/xfiles.jwg','1993','Chris Carter','Deux agents du FBI sont chargés d\'enquêter sur les dossiers non résolus, appelés \"X-files\" la plupart du temps des affaires où le paranormal entre en jeu. L\'agent Fox Mulder, malgré le scepticisme de sa co-équipière Dana Scully, tente de prouver sa thèse du complot gouvernement/extra-terrestres... Fox Mulder n\'aura de cesse de rechercher sa soeur disparue des années auparavant lorsqu\'il avait 12 ans.');
